import "./App.scss";
import bg1 from "./assets/images/bg1.jpg";
import bg2 from "./assets/images/bg2.jpg";
import bg3 from "./assets/images/bg3.jpg";

function App() {
  return (
    <div className='main-content'>
      {/* cover 1 */}
      <div className='cover1'>
        <img src={bg1} alt='' />
        <div className='cover-text'>
          <div className='text1'>delighted</div>
          <div className='text1'>to share our</div>
          <div className='text2'>upcoming</div>
          <div className='text2'>wedding</div>
        </div>
      </div>
      {/* end cover 1 */}
      {/* cover 2 */}
      <div className='cover2'>
        <div className='cover-text'>
          <div className='text1'>
            All beings are flowers blooming in a blossoming universe.
          </div>
        </div>
        <img src={bg2} alt='' />
      </div>
      {/* end cover 2 */}
      {/* cover 3 */}
      <div className='cover3'>
        <img src={bg3} alt='' />
      </div>
      {/* end cover 3 */}
      {/* section 4 */}
      <div className='cover3'>
        <img src={bg3} alt='' />
      </div>
      {/* end section 4 */}
    </div>
  );
}

export default App;
